// redux/textAnimate.js
import { createSlice } from '@reduxjs/toolkit';

const initialState = {
    textAnimate: {

    },
};

export const textAnimateSlice = createSlice({
    name: 'textAnimate',
    initialState,
    reducers: {
        setTextAnimate: (state, action) => {
            state.textAnimate = action.payload;
        },
    },
});

export const { setTextAnimate } = textAnimateSlice.actions;

